import { IconButton, SvgIcon, IconText } from "./style.js";
import { useDarkMode } from "../../../../app/model/useDarkModeState/useDarkModeState.js";
const AsideIcon = (props) => {
  const { darkModeState } = useDarkMode();
  console.log("resourceWhite:", props.resourceWhite);
  return (
    <IconButton onClick={props.onClick}>
      <SvgIcon
        style={{
          backgroundImage: `url(${
            darkModeState ? props.resourceWhite.default : props.resource.default
          })`,
        }}
      />
      {props.content && <IconText>{props.content}</IconText>}
    </IconButton>
  );
};

export default AsideIcon;
